    Room[] public rooms;

    function createRoom(uint256 _id, string memory _name,address _owner) public returns (bool) {
        rooms.push(Room({
            id:_id,
            name:_name,
            owner:_owner,
            capacity:18 
            }));
        return true;
    }

    function getRoom(uint256 _id) public view returns (string memory name, uint id) {
        Room storage room =  rooms[_id];
        return (room.name, room.id);
    }

    function getRoomCapacity(uint256 _id) public view returns (uint256 capacity) {
        Room storage room =  rooms[_id];
        return (room.capacity);
    }

    function getRoomOwner(uint256 _id) public view returns (address addr) {
        Room storage room =  rooms[_id];
        return (room.owner);
    }

